package main
import (
  "bytes"
  "compress/gzip"
  "encoding/base64"
  "io"
  "github.com/computeportal/glui"
)
const (
  jaguar_data =""
)
var jaguar = &glui.ImageData{nil, 900, 724}
func load_jaguar() bool {
  b, err := base64.StdEncoding.DecodeString(jaguar_data)
  if err != nil {panic(err)}
  r, err := gzip.NewReader(bytes.NewBuffer(b))
  if err != nil {panic(err)}
  c := &bytes.Buffer{}
  io.Copy(c, r)
  jaguar.Pix = c.Bytes()
  return true
}
var jaguar_loaded = load_jaguar()